import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {
  return (
    <div className='hero-container'>
      <video src='/videos/Zach.mp4' autoPlay loop muted />
      <img src = '/images/one.png' style = {{width : '40px', height : '40px', borderRadius : '5px'}} class="rounded mx-auto d-block"/>
      <h1>Korean-American Scientists and Engineers Association</h1>
      <p>Texas A&M University</p>

      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          LOG IN
        </Button>
      </div>
    </div>
  );
}

export default HeroSection;
